import Vue from 'vue'
import VueRouter from 'vue-router'
import HomeView from '../views/HomeView.vue'
import HowItWorks from '../views/HowItWorks'
import BecomeAPartner from '../views/BecomeAPartner'
import AboutUs from '../views/HowItWorks'

Vue.use(VueRouter)

const routes = [
  {
    path: '/',
    name: 'home',
    component: HomeView
  },
  {
    path: '/howitworks',
    name: 'howitworks',
    component: HowItWorks
  },
  {
    path: '/becomeapartner',
    name: 'becomeapartner',
    component: BecomeAPartner
  },
  {
    path: '/aboutus',
    name: 'aboutus',
    component: AboutView
  }
]

const router = new VueRouter({
  mode: 'history',
  base: process.env.BASE_URL,
  routes
})

export default router
